import React, { useRef } from 'react';
import jsPDF from 'jspdf';
import html2canvas from 'html2canvas';

const Results = ({ answers, shuffledQuestions, onRetake }) => {
  const reportRef = useRef();

  // Categories matching the questions
  const categories = [
    'Cognitive Flexibility',
    'Metacognition', 
    'Working Memory',
    'Organization',
    'Emotional Regulation',
    'Inhibitory & Impulse Control',  
    'Task Initiation & Motivation',
    'Sustained Attention',
    'Time Management'
  ];

  // Calculate scores for each category using shuffled questions
  const calculateScores = () => {
    const scores = {};

    // Initialize scores for each category
    categories.forEach(category => {
      scores[category] = {
        answers: [],
        raw: 0,
        percentage: 50,
        questionsAnswered: 0
      };
    });

    // Debug logging
    console.log('=== SCORING DEBUG ===');
    console.log('Shuffled Questions Order:', shuffledQuestions.map(q => ({ id: q.id, category: q.category, text: q.text.substring(0, 50) + '...' })));
    console.log('Answers Array:', answers);

    // Group answers by category based on shuffled questions
    shuffledQuestions.forEach((question, index) => {
      if (answers[index] !== undefined) {
        const categoryName = question.category;
        const answerValue = answers[index];

        console.log(`Question ${index + 1}: "${question.text.substring(0, 30)}..." â†’ Category: ${categoryName} â†’ Answer: ${answerValue}`);

        if (scores[categoryName]) {
          scores[categoryName].answers.push(answerValue);
        }
      }
    });

    // Calculate final scores for each category
    Object.keys(scores).forEach(category => {
      const categoryAnswers = scores[category].answers;
      const rawScore = categoryAnswers.reduce((sum, answer) => sum + answer, 0);
      const percentage = Math.round(((rawScore + (categoryAnswers.length * 3)) / (categoryAnswers.length * 6)) * 100);

      console.log(`${category}: Answers [${categoryAnswers.join(', ')}] â†’ Raw: ${rawScore} â†’ Percentage: ${percentage}%`);

      scores[category] = {
        raw: rawScore,
        percentage: percentage,
        questionsAnswered: categoryAnswers.length
      };
    });

    console.log('Final Scores:', scores);
    console.log('=== END DEBUG ===');

    return scores;
  };

  const scores = calculateScores();

  // Get color category based on percentage
  const getColorCategory = (percentage) => {
    if (percentage > 60) return 'excellent';
    if (percentage >= 40) return 'good';
    return 'needs-improvement';
  };

  // Enhanced radar chart using SVG with scale labels
  const RadarChart = ({ scores }) => {
    const size = 400;
    const center = size / 2;
    const radius = size / 2 - 60;
    const categories = Object.keys(scores);
    const values = Object.values(scores).map(s => s.percentage);

    const angleStep = (2 * Math.PI) / categories.length;

    // Generate points for the data polygon
    const dataPoints = values.map((value, index) => {
      const angle = index * angleStep - Math.PI / 2; // Start from top
      const r = (value / 100) * radius;
      const x = center + r * Math.cos(angle);
      const y = center + r * Math.sin(angle);
      return `${x},${y}`;
    }).join(' ');

    // Generate points for the outer polygon (scale lines)
    const outerPoints = categories.map((_, index) => {
      const angle = index * angleStep - Math.PI / 2;
      const x = center + radius * Math.cos(angle);
      const y = center + radius * Math.sin(angle);
      return { x, y, angle, category: categories[index] };
    });

    // Scale levels and their labels - evenly spaced from -18 to +18
    const scaleRings = [
      { scale: 0.2, label: '-18' },
      { scale: 0.4, label: '-9' },
      { scale: 0.6, label: '0' },
      { scale: 0.8, label: '+9' },
      { scale: 1.0, label: '+18' }
    ];

    return (
      <div className="radar-chart-container">
        <svg width={size} height={size} style={{ overflow: 'visible' }}>
          {/* Background grid circles */}
          {scaleRings.map(({ scale }) => (
            <circle
              key={scale}
              cx={center}
              cy={center}
              r={radius * scale}
              fill="none"
              stroke="#e5e7eb"
              strokeWidth="1"
            />
          ))}

          {/* Grid lines from center to each point */}
          {outerPoints.map((point, index) => (
            <line
              key={index}
              x1={center}
              y1={center}
              x2={point.x}
              y2={point.y}
              stroke="#e5e7eb"
              strokeWidth="1"
            />
          ))}

          {/* Data polygon */}
          <polygon
            points={dataPoints}
            fill="rgba(53, 92, 125, 0.2)"
            stroke="#355c7d"
            strokeWidth="3"
          />

          {/* Data points */}
          {values.map((value, index) => {
            const angle = index * angleStep - Math.PI / 2;
            const r = (value / 100) * radius;
            const x = center + r * Math.cos(angle);
            const y = center + r * Math.sin(angle);
            return (
              <circle
                key={index}
                cx={x}
                cy={y}
                r="5"
                fill="#355c7d"
                stroke="white"
                strokeWidth="2"
              />
            );
          })}

          {/* Category labels */}
          {outerPoints.map((point, index) => {
            // Position labels outside the chart
            const labelDistance = radius + 35;
            const labelX = center + labelDistance * Math.cos(point.angle);
            const labelY = center + labelDistance * Math.sin(point.angle);

            return (
              <text
                key={index}
                x={labelX}
                y={labelY}
                textAnchor="middle"
                dominantBaseline="middle"
                fontSize="13"
                fill="#4b5563"
                style={{ fontWeight: '500' }}
                transform={`rotate(0 ${labelX} ${labelY})`}
              >
                <tspan x={labelX} dy="0">{point.category.split(' ')[0]}</tspan>
                {point.category.split(' ').length > 1 && (
                  <tspan x={labelX} dy="15">{point.category.split(' ').slice(1).join(' ')}</tspan>
                )}
              </text>
            );
          })}

          {/* Scale labels - positioned on top */}
          {scaleRings.map(({ scale, label }) => (
            <text
              key={`label-${scale}`}
              x={center}
              y={center - radius * scale - 5}
              textAnchor="middle"
              fontSize="10"
              fill="#9ca3af"
              fontWeight="500"
            >
              {label}
            </text>
          ))}
        </svg>
      </div>
    );
  };

  // Generate and download PDF report
  const downloadReport = async () => {
    const element = reportRef.current;
    const canvas = await html2canvas(element, {
      scale: 2,
      useCORS: true,
      allowTaint: true,
      backgroundColor: '#ffffff',
      width: element.scrollWidth,
      height: element.scrollHeight
    });

    const imgData = canvas.toDataURL('image/png', 1.0);
    const pdf = new jsPDF({
      orientation: 'portrait',
      unit: 'mm',
      format: 'a4'
    });

    const pdfWidth = pdf.internal.pageSize.getWidth();
    const pdfHeight = pdf.internal.pageSize.getHeight();
    const imgWidth = pdfWidth;
    const imgHeight = (canvas.height * pdfWidth) / canvas.width;
    let heightLeft = imgHeight;

    let position = 0;

    pdf.addImage(imgData, 'PNG', 0, position, imgWidth, imgHeight);
    heightLeft -= pdfHeight;

    while (heightLeft >= 0) {
      position = heightLeft - imgHeight;
      pdf.addPage();
      pdf.addImage(imgData, 'PNG', 0, position, imgWidth, imgHeight);
      heightLeft -= pdfHeight;
    }

    const today = new Date().toISOString().split('T')[0];
    pdf.save(`Neurish-EF-Report-${today}.pdf`);
  };

  return (
    <div className="container">
      <div className="card results-container">
        <h2>Your Neurish Profile</h2>
        <p style={{ fontSize: '24px', color: '#6b7280', marginBottom: '40px' }}>
          Find. Focus. Flourish.
        </p>

        <p style={{ marginBottom: '40px', color: '#4b5563', fontSize: '18px' }}>
          Here's your personalized executive functioning profile across nine key domains. 
          Each category is scored based on your responses to shuffled questions.
        </p>

        <div style={{ display: 'flex', gap: '20px', marginBottom: '40px', justifyContent: 'center' }}>
          <button 
            className="btn btn-primary" 
            onClick={downloadReport}
            style={{ display: 'flex', alignItems: 'center', gap: '8px' }}
          >
            ðŸ“„ Download Report
          </button>

          <button 
            className="btn btn-secondary" 
            onClick={onRetake}
          >
            ðŸ”„ Retake Assessment
          </button>
        </div>

        {/* Downloadable Report Content */}
        <div ref={reportRef} style={{ backgroundColor: 'white', padding: '40px', borderRadius: '12px' }}>
          {/* Report Header */}
          <div style={{ textAlign: 'center', marginBottom: '40px', borderBottom: '2px solid #e5e7eb', paddingBottom: '30px' }}>
            <h1 style={{ fontSize: '36px', fontWeight: '300', color: '#1f2937', marginBottom: '10px' }}>
              Neurish
            </h1>
            <p style={{ fontSize: '18px', color: '#6b7280', marginBottom: '20px' }}>
              Executive Functioning Assessment Report
            </p>
            <p style={{ fontSize: '14px', color: '#9ca3af' }}>
              Generated on {new Date().toLocaleDateString('en-US', { 
                year: 'numeric', 
                month: 'long', 
                day: 'numeric' 
              })}
            </p>
          </div>

          {/* Introduction */}
          <div style={{ marginBottom: '40px' }}>
            <h3 style={{ fontSize: '20px', fontWeight: '500', color: '#1f2937', marginBottom: '16px' }}>
              About Executive Functioning
            </h3>
            <p style={{ fontSize: '16px', lineHeight: '1.6', color: '#4b5563', marginBottom: '16px' }}>
              Executive functioning refers to a set of mental skills including working memory, flexible thinking, 
              and self-control. These skills help us learn, work, and manage daily life. Everyone has strengths 
              and challenges in different areas.
            </p>
            <p style={{ fontSize: '16px', lineHeight: '1.6', color: '#4b5563' }}>
              This assessment evaluated your self-perception across nine key executive functioning domains using 
              54 carefully crafted questions. Your results provide insights into your cognitive strengths and 
              areas where you might benefit from targeted strategies.
            </p>
          </div>

          {/* Radar Chart */}
          <div style={{ textAlign: 'center', marginBottom: '40px' }}>
            <h3 style={{ fontSize: '20px', fontWeight: '500', color: '#1f2937', marginBottom: '20px' }}>
              Your Executive Functioning Profile
            </h3>
            <RadarChart scores={scores} />
          </div>

          {/* Page Break Before Detailed Scores */}
          <div style={{ pageBreakBefore: 'always' }}>
            {/* Detailed Scores */}
            <div style={{ marginBottom: '40px' }}>
              <h3 style={{ fontSize: '20px', fontWeight: '500', color: '#1f2937', marginBottom: '20px' }}>
                Detailed Results by Domain
              </h3>
              <div className="category-scores">
                {Object.entries(scores).map(([category, data]) => (
                  <div 
                    key={category} 
                    className={`category-card ${getColorCategory(data.percentage)}`}
                    style={{ marginBottom: '16px' }}
                  >
                    <h3>{category}</h3>
                    <div className="score">{data.percentage}%</div>
                    <div className="raw-score">
                      Raw Score: {data.raw > 0 ? '+' : ''}{data.raw}/{data.questionsAnswered * 3}
                      {data.questionsAnswered < 6 && (
                        <span style={{ display: 'block', fontSize: '12px', color: '#ef4444', marginTop: '4px' }}>
                          ({data.questionsAnswered}/6 questions answered)
                        </span>
                      )}
                    </div>
                  </div>
                ))}
              </div>
            </div>

            {/* Understanding Your Results */}
            <div style={{ marginBottom: '40px' }}>
              <h3 style={{ fontSize: '20px', fontWeight: '500', color: '#1f2937', marginBottom: '20px' }}>
                Understanding Your Results
              </h3>

              <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '20px', marginBottom: '24px' }}>
                <div style={{ textAlign: 'center', padding: '16px', backgroundColor: '#f0fdf4', borderRadius: '8px' }}>
                  <div style={{ 
                    width: '20px', 
                    height: '20px', 
                    backgroundColor: '#10b981', 
                    borderRadius: '4px', 
                    margin: '0 auto 8px' 
                  }}></div>
                  <div style={{ fontWeight: '500', color: '#1f2937', marginBottom: '4px' }}>Excellent (Above 60%)</div>
                  <div style={{ fontSize: '14px', color: '#6b7280' }}>Strong functioning in this area</div>
                </div>
                <div style={{ textAlign: 'center', padding: '16px', backgroundColor: '#fffbeb', borderRadius: '8px' }}>
                  <div style={{ 
                    width: '20px', 
                    height: '20px', 
                    backgroundColor: '#f59e0b', 
                    borderRadius: '4px', 
                    margin: '0 auto 8px' 
                  }}></div>
                  <div style={{ fontWeight: '500', color: '#1f2937', marginBottom: '4px' }}>Good (40-60%)</div>
                  <div style={{ fontSize: '14px', color: '#6b7280' }}>Developing skills with room for growth</div>
                </div>
                <div style={{ textAlign: 'center', padding: '16px', backgroundColor: '#fef2f2', borderRadius: '8px' }}>
                  <div style={{ 
                    width: '20px', 
                    height: '20px', 
                    backgroundColor: '#ef4444', 
                    borderRadius: '4px', 
                    margin: '0 auto 8px' 
                  }}></div>
                  <div style={{ fontWeight: '500', color: '#1f2937', marginBottom: '4px' }}>Growing (Below 40%)</div>
                  <div style={{ fontSize: '14px', color: '#6b7280' }}>Areas that may benefit from strategies</div>
                </div>
              </div>

              <div style={{ backgroundColor: '#f9fafb', padding: '20px', borderRadius: '8px', marginBottom: '20px' }}>
                <h4 style={{ fontSize: '16px', fontWeight: '500', color: '#1f2937', marginBottom: '12px' }}>
                  What Your Scores Mean
                </h4>
                <ul style={{ paddingLeft: '20px', color: '#4b5563', lineHeight: '1.6' }}>
                  <li style={{ marginBottom: '8px' }}>
                    <strong>High scores (60%+)</strong> suggest you perceive yourself as having strong skills in that domain
                  </li>
                  <li style={{ marginBottom: '8px' }}>
                    <strong>Moderate scores (40-60%)</strong> indicate areas where you function adequately but could develop further
                  </li>
                  <li style={{ marginBottom: '8px' }}>
                    <strong>Lower scores (below 40%)</strong> may represent opportunities for growth and skill development
                  </li>
                </ul>
              </div>
            </div>
          </div>

          {/* Page Break Before Domain Explanations */}
          <div style={{ pageBreakBefore: 'always' }}>
            {/* Domain Explanations */}
            <div style={{ marginBottom: '40px' }}>
              <h3 style={{ fontSize: '20px', fontWeight: '500', color: '#1f2937', marginBottom: '20px' }}>
                Executive Functioning Domains Explained
              </h3>

              <div style={{ display: 'grid', gap: '16px' }}>
                {[
                  { name: 'Working Memory', desc: 'The ability to hold and manipulate information in your mind while completing tasks.' },
                  { name: 'Cognitive Flexibility', desc: 'The skill to switch between different concepts, adapt to new situations, and think creatively.' },
                  { name: 'Inhibitory & Impulse Control', desc: 'The capacity to resist impulses, think before acting, and control behavior appropriately.' },
                  { name: 'Organization', desc: 'The ability to create and maintain systems for managing materials, information, and time.' },
                  { name: 'Task Initiation & Motivation', desc: 'The skill to begin tasks independently and maintain motivation to complete them.' },
                  { name: 'Sustained Attention', desc: 'The capacity to maintain focus on activities or tasks despite distractions.' },
                  { name: 'Emotional Regulation', desc: 'The ability to manage emotions appropriately and respond to situations with emotional balance.' },
                  { name: 'Metacognition', desc: 'The awareness of your own thinking processes and the ability to monitor and evaluate your performance.' },
                  { name: 'Time Management', desc: 'The skill to estimate time, prioritize tasks, and meet deadlines effectively.' }
                ].map((domain, index) => (
                  <div key={index} style={{ padding: '16px', backgroundColor: '#f9fafb', borderRadius: '8px', borderLeft: '4px solid #355c7d' }}>
                    <h4 style={{ fontSize: '16px', fontWeight: '500', color: '#1f2937', marginBottom: '8px' }}>
                      {domain.name}
                    </h4>
                    <p style={{ fontSize: '14px', color: '#4b5563', lineHeight: '1.5' }}>
                      {domain.desc}
                    </p>
                  </div>
                ))}
              </div>
            </div>

            {/* Footer */}
            <div style={{ textAlign: 'center', borderTop: '2px solid #e5e7eb', paddingTop: '20px', color: '#6b7280' }}>
              <p style={{ fontSize: '14px', marginBottom: '8px' }}>
                <strong>Important:</strong> This assessment reflects your self-perception and is for informational purposes only.
              </p>
              <p style={{ fontSize: '14px' }}>
                For comprehensive evaluation or concerns, consider consulting with a qualified professional.
              </p>
              <p style={{ fontSize: '12px', marginTop: '16px', color: '#9ca3af' }}>
                Generated by Neurish â€¢ Find. Focus. Flourish.
              </p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Results;
